import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Layout from './components/Layout';
import HomeDashboard from './components/HomeDashboard';
import TodoDashboard from './components/TodoDashboard';
import PolicyDashboard from './components/PolicyDashboard';

// 모달 컴포넌트는 일단 빈 컴포넌트로 생성해둡니다.
function RegisterModal({ onClose }) {
  return (
    <div className="fixed inset-0 bg-black bg-opacity-30 flex items-center justify-center z-50">
      <div className="bg-white rounded-lg p-8 min-w-[320px]">
        <h2 className="text-xl font-bold mb-4">경영방침 등록</h2>
        <div className="flex flex-col space-y-4">
          <button className="bg-blue-500 text-white px-4 py-2 rounded">직접 등록</button>
          <button className="bg-blue-500 text-white px-4 py-2 rounded">이미지 등록</button>
        </div>
        <button onClick={onClose} className="mt-6 text-gray-500">닫기</button>
      </div>
    </div>
  );
}
function SealModal({ onClose }) {
  return (
    <div className="fixed inset-0 bg-black bg-opacity-30 flex items-center justify-center z-50">
      <div className="bg-white rounded-lg p-8 min-w-[400px] max-w-lg w-full">
        <h2 className="text-xl font-bold mb-4">사업장</h2>
        {/* 실제 입력 폼은 추후 구현, 일단 빈칸 */}
        <div className="space-y-2 mb-4">
          <div className="bg-gray-100 h-10 rounded" />
          <div className="bg-gray-100 h-10 rounded" />
          <div className="bg-gray-100 h-10 rounded" />
        </div>
        <button onClick={onClose} className="mt-6 text-gray-500">닫기</button>
      </div>
    </div>
  );
}
function PolicyEditModal({ onClose }) {
  return (
    <div className="fixed inset-0 bg-black bg-opacity-30 flex items-center justify-center z-50">
      <div className="bg-white rounded-lg p-8 min-w-[400px] max-w-lg w-full">
        <h2 className="text-xl font-bold mb-4">경영방침 수정</h2>
        {/* 실제 입력 폼은 추후 구현, 일단 빈칸 */}
        <div className="space-y-2 mb-4">
          <div className="bg-gray-100 h-10 rounded" />
          <div className="bg-gray-100 h-10 rounded" />
          <div className="bg-gray-100 h-10 rounded" />
        </div>
        <button onClick={onClose} className="mt-6 text-gray-500">닫기</button>
      </div>
    </div>
  );
}

function App() {
  const [showRegister, setShowRegister] = useState(false);
  const [showSeal, setShowSeal] = useState(false);
  const [showEdit, setShowEdit] = useState(false);

  return (
    <Router>
      <Layout>
        <Routes>
          <Route path="/" element={<HomeDashboard />} />
          <Route path="/home/todo" element={<TodoDashboard />} />
          <Route path="/policy" element={
            <>
              <PolicyDashboard
                onOpenRegister={() => setShowRegister(true)}
                onOpenSeal={() => setShowSeal(true)}
                onOpenEdit={() => setShowEdit(true)}
              />
              {showRegister && <RegisterModal onClose={() => setShowRegister(false)} />}
              {showSeal && <SealModal onClose={() => setShowSeal(false)} />}
              {showEdit && <PolicyEditModal onClose={() => setShowEdit(false)} />}
            </>
          } />
        </Routes>
      </Layout>
    </Router>
  );
}

export default App;
